import React, { useState } from "react";
import axios from "axios";


function Registration(){
    const [status, setStatus] = useState({email: '', username:'', password: ''});

    function handleChange(e){
        const {name, value} = e.target;
        setState(prevState => ({
            ...prevState,
            [name]: value
         }));
    }

    return(
        <div>
            <form onSubmit = {handleSubmit}>
                <label>
                    Username:<br/>
                    <input type="text" value={status.email} onChange={handleChange(e)} name = "email"/><br/>
                </label>
                <label>
                    Email:<br/>
                    <input type="text" value={status.username} onChange={handleChange(e)} name = "username"/><br/>
                </label>
                <label>
                    Password:<br/>
                    <input type="text" value={status.password} onChange={handleChange(e)} name = "password"/><br/>
                </label>
                <input type = "submit" value = "Submit"></input>
            </form>
            {status.username} <br/>
            {status.password} <br/>

        </div>
    );
}


export default Registration;
